  //     response => {
  //       console.log('Cart updated successfully:', response);
  //     },
  //     error => {
  //       console.error('An error occurred while adding book to cart:', error);
  //     }
  //   );
  // }
  // getCartIdFromSomeSource(): number | undefined {

  //   const cartId: number | undefined =  this.route.snapshot.queryParamMap.get('cartId');
  //   return cartId;
  // }
  }

  getBooksByType(): void {
    this.bookService.getBooksByType(this.selectBookType).subscribe(
      (response: Book[]) => {
        this.books = response;
      },
      (error) => {
        console.error('Error fetching books by type:', error);
      }
    );
  }


}
